import React from 'react'
import Imagen1 from '../img/Imágenes de productos/MIGAS_PIGMENTOS/3.png'
import Imagen2 from '../img/Logos y recursos/fda.png'

class Pagina extends React.Component {
    render(){
        return (
            <div>
            <div>
                <img src={Imagen1}/>
            </div>
            {/* <div>
                <img src={Imagen2}/>
            </div> */}
        </div>
        )
       
    }

}

export default Pagina
